schemas:
DEFINE TABLE OVERWRITE influenced_by SCHEMAFULL TYPE RELATION IN user OUT user ENFORCED;

DEFINE FIELD OVERWRITE order on influenced_by TYPE int; 
DEFINE FIELD OVERWRITE influence_type on influenced_by TYPE int DEFAULT 1;
DEFINE FIELD OVERWRITE description ON influenced_by TYPE string DEFAULT "";
DEFINE FIELD OVERWRITE beatmaps ON influenced_by TYPE set<int> DEFAULT [];
DEFINE FIELD OVERWRITE updated_at ON influenced_by type datetime VALUE time::now();
DEFINE FIELD OVERWRITE created_at ON influenced_by type datetime VALUE time::now() READONLY;

DEFINE TABLE OVERWRITE script_migration SCHEMAFULL
    PERMISSIONS
        FOR select FULL
        FOR create, update, delete NONE;

DEFINE FIELD OVERWRITE script_name ON script_migration TYPE string;
DEFINE FIELD OVERWRITE executed_at ON script_migration TYPE datetime VALUE time::now() READONLY;
DEFINE TABLE OVERWRITE user SCHEMAFULL;

DEFINE FIELD OVERWRITE username ON user TYPE string;
DEFINE FIELD OVERWRITE avatar_url ON user TYPE string;
DEFINE FIELD OVERWRITE country ON user TYPE string;
DEFINE FIELD OVERWRITE bio ON user TYPE string DEFAULT "";
DEFINE FIELD OVERWRITE ranked_mapper ON user TYPE bool DEFAULT false;
DEFINE FIELD OVERWRITE authenticated ON user TYPE bool DEFAULT false;
DEFINE FIELD OVERWRITE beatmaps ON user TYPE set<int> DEFAULT [];
DEFINE FIELD OVERWRITE updated_at ON user type datetime VALUE time::now();
DEFINE FIELD OVERWRITE created_at ON user type datetime VALUE time::now() READONLY;
